import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import About from "./components/About";

function App() {
  return (
    <>
      <Routes>
        <Navbar/>
        <Route exact path="/about" require={<About/>}/>
        <Route exact path="/home" require={<Home/>}/>
      </Routes>
    </>
  );
}

export default App;
